import './App.css';
import PostsList from './Components/postsList';
import UserList from './Components/usersList';
//import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <div className='App'>
        <PostsList />
        <UserList />
      </div>

    );
  }

}

export default App;
